/** @format */

import React from "react";
import { CardImageBlock, CardImageItem } from "./StyleStoreCard";
const CardImage = ({ images }) => {
  if (images.length < 3) {
    return (
      <CardImageBlock>
        <CardImageItem />
      </CardImageBlock>
    );
  } else {
    return (
      <CardImageBlock>
        <CardImageItem style={{ width: "75%", marginRight: "10px" }} />
        <div style={{ width: "25%", display: "flex", flexDirection: "column" }}>
          <CardImageItem style={{ height: "50%", marginBottom: 10 }} />
          <CardImageItem style={{ height: "50%" }} />
        </div>
      </CardImageBlock>
    );
  }
};

export default CardImage;
